import React from 'react';


function Dialogs(props) {
    return (
        <div className="dialog-items">
            <div className="dialog-items"></div>
            <div className="dialog">Dima</div>
            <div className="dialog">Ann</div>
            <div className="dialog">Art</div>
            <div className="dialog">Eva</div>
            <div className="dialog">Karen</div>




            <div className="messages">
                <div ></div>
            </div>

        </div>
    )
}


export default Dialogs;
